  width: '100%',
  padding: '60px',
  boxSizing: 'border-box',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  backgroundColor: 'secondary.main',
});

export const contactsHeaderStyles = { mb: '3%', mt: '3%' };
export const contactsTextStyles = {
  marginBottom: '20px',
  // color: 'primary.main',
};
